import React, { PureComponent } from "react";
import {
  BarChart,
  Bar,
  Brush,
  ReferenceLine,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";
import Data from "../Data/tableData";

const data = [
  {
    subject: "Math",
    A: 67,
    fullMark: 100,
  },
  {
    subject: "Chinese",
    A: 120,
    fullMark: 100,
  },
  {
    subject: "English",
    A: 120,
    fullMark: 100,
  },
  {
    subject: "Geography",
    A: 120,
    fullMark: 100,
  },
  {
    subject: "Physics",
    A: 120,
    fullMark: 100,
  },
  {
    subject: "History",
    A: 120,
    fullMark: 100,
  },
];

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/mc8r7e6p/";

  render() {
    return (
      <BarChart
        width={1000}
        height={300}
        data={data}
        margin={{
          top: 5,
          right: 30,
          left: 20,
          bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend
          payload={[
            {
              id: "มิติกิจกรรมการทำงาน",
              value: "มิติกิจกรรมการทำงาน",
              type: "square",
              color: "#8884d8",
            },
            {
              id: "มิติบริบทการทำงาน",
              value: "มิติบริบทการทำงาน",
              type: "square",
              color: "#82ca9d",
            },
            {
              id: "ค่าเฉลี่ย",
              value: "ค่าเฉลี่ย",
              type: "square",
              color: "#66ffcd",
            },
          ]}
        />
        <ReferenceLine y={0} stroke="#000" />
        <Brush dataKey="name" height={30} stroke="#8884d8" />
        <Bar dataKey="activity" fill="#8884d8" />
        <Bar dataKey="context" fill="#82ca9d" />
        <Bar dataKey="mean" fill="#66ffcd" />
      </BarChart>
    );
  }
}
